function convertObject(input) {
    // Extract necessary values from the input object
    const pickableId = input.pickable.pickableId;
    const targetValue = input.activeMarket.targetValue;
    const marketName = input.pickable.marketCategory.marketName;
    const displayName = input.pickable.pickableEntities[0].displayName;

    // TODO: THIS IS CLOSE: need to pull out more and less

    // Return the resulting object
    return {
        pickableId: pickableId,
        targetValue: targetValue,
        marketName: marketName,
        displayName: displayName
    };
}

